import './Summary.css';

const Summary =()=>{
  return(
     <div className="summary">
        <h2>Delicious Food, Delivered to You</h2>
        <p>Choose your favourite meal 
            from our broad
            selection of available meals 
            and enjoy a delicious lunch or dinner
           at home.</p>
          <p>All our meals are cooked with
            high-quality ingredients,just-in-time 
            and ofcourse by experienced chefs.
          </p>
     </div>
  );
}

export default Summary;
